import './Card.css';
function Card({ data }) {
    console.log(data)

    return (
        <div className='card'  style="width: 18rem;">

            <div>
                <img src={`http://localhost:5000/${data.imageUrl}`} alt={data.name} className="card-img-top" key={data.id} />
            </div>
            <div className="card-body">
                <h2 className="card-title">{data.name}</h2>
                <p className="card-text">{data.description}</p>
                <p className="card-text">{data.price}</p>
            </div>
            



        </div>


    )
}

export default Card;
